import React from 'react';
import style from './Main_DogCard.module.css';

export const Main_DogCard = (props) => {
    const backgroundImage = {
        backgroundImage: URL(props.image)
    }

    return (
        <div style={backroundImage}>
            <div>
                <p></p>
            </div>
        </div>
    )
}
